import React from "react";
import { BrowserRouter } from "react-router-dom";
import "./App.css";
import { AuthPage } from "./pages/auth";
import { ThemeProvider } from "./ThemeProvider";

function App() {
  return (
    <ThemeProvider>
      <BrowserRouter>
        <AuthPage />
      </BrowserRouter>
    </ThemeProvider>
  );
}

export default App;
